The Navy SEALs: Their Untold Story

War Documentary hosted by Gary Sinise, published by PBS in 2014 - English narration


Information
------------------------------

NAVY SEALs--THEIR UNTOLD STORY details their fascinating transformation and the people who made this story happen. Discover how these clandestine commandoes morphed with evolving threats from Hitler to bin Laden. The Navy's first special warfare units date back to World War II, and, without them, much of U.S. and world history would have been written differently, from the beaches of Normandy to the Pacific theater, Korea, Vietnam, Iraq, and Afghanistan. Through firsthand accounts and never-before-seen footage, this unprecedented documentary recounts many of the ticking-clock missions of the &quot;Commandoes of the Deep.&quot;

